data.query:
query Browse($category: String, $filters: [BrowseFilterInput], $filtersVersion: Int, $query: String, $sort: BrowseSortInput, $page: BrowsePageInput, $currency: CurrencyCode, $country: String!, $market: String, $staticRanking: BrowseExperimentStaticRankingInput) {
  browse(
    category: $category
    filters: $filters
    filtersVersion: $filtersVersion
    query: $query
    sort: $sort
    page: $page
    experiments: {staticRanking: $staticRanking}
  ) {
    suggestions {
      isCuratedPage
      relatedPages {
        title
        url
      }
      locales
    }
    results {
      edges {
        objectId
        node {
          ... on Product {
            ...BrowseProductDetailsFragment
            ...FavoriteProductFragment
            ...ProductTraitsFragment
            ...FavoriteVariantsFragment
            market(currencyCode: $currency) {
              ...MarketFragment
            }
          }
          ... on Variant {
            id
            ...FavoriteVariantFragment
            product {
              ...BrowseProductDetailsFragment
              ...FavoriteProductFragment
              ...FavoriteVariantsFragment
              traits(filterTypes: [RELEASE_DATE, RETAIL_PRICE]) {
                name
                value
              }
            }
            market(currencyCode: $currency) {
              ...MarketFragment
            }
            traits {
              size
            }
          }
        }
      }
      pageInfo {
        limit
        page
        pageCount
        queryId
        queryIndex
        total
      }
    }
    query
  }
}

fragment FavoriteProductFragment on Product {
  favorite
}

fragment FavoriteVariantFragment on Variant {
  favorite
}

fragment FavoriteVariantsFragment on Product {
  variants {
    id
    hidden
    favorite
    traits {
      size
    }
  }
}

fragment ProductTraitsFragment on Product {
  productTraits: traits(filterTypes: [RELEASE_DATE, RETAIL_PRICE]) {
    name
    value
  }
}

fragment MarketFragment on Market {
  currencyCode
  state(country: $country, market: $market) {
    numberOfCustodialAsks
    lowestAsk {
      amount
      updatedAt
    }
    highestBid {
      amount
      updatedAt
    }
  }
  salesInformation {
    lastSale
    lastSaleDate
    salesThisPeriod
    salesLastPeriod
    changeValue
    changePercentage
    volatility
    pricePremium
  }
  deadStock {
    sold
    averagePrice
  }
  statistics {
    last90Days {
      averagePrice
    }
  }
}

fragment BrowseProductDetailsFragment on Product {
  id
  name
  urlKey
  title
  brand
  description
  model
  condition
  productCategory
  listingType
  gender
  browseVerticals
  media {
    thumbUrl
    smallImageUrl
  }
}
